import ListaConsulta from './ListaConsulta'
import React from 'react'

function HomeConsultas(){
    try{
        const enquiries = (axios.get('http://localhost:5000/enquiries')).data;
    }catch(error){
        console.log(error);
    }
    return(
        <div>
            <ListaConsulta enquiries = {enquiries} />

        </div>
    );
}

export default HomeConsultas;
